import React, { Component } from 'react';
import { connect } from 'react-redux';
import './PartieInformation.css';
import Subject from '@material-ui/icons/Subject';

class PartieInformation extends Component {
  render() {
    return (
      <div className="mainChild">
      <Subject root='width: 400px; height: 400px;' />
        <img src={ require('../../images/ps_logo.png')} style={{width: '250px', height: '220px'}} alt={this.props.currentPartie.description} />
          <div className="partieInformationContent">
            <h3>{this.props.currentPartie.party_name} - {this.props.currentPartie.description}</h3>
          </div>
      </div>
    );
  }
}

function mapStateToProps(state) {
  return {
    currentPartie: state.parties.currentPartie
  };
}

function mapDispatchToProps(dispatch) {
  return { };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(PartieInformation);
